import React from "react";
import Bear from "../images/bear.png";

const Landing = () => {
  return (
    <div className="landing-page">
      <h1 className="landing-page-title">Welcome to our online store!</h1>
      <p className="landing-page-desc">
        The world is changing and you can buy almost anything online so why not
        shop for a new pet with us. We have a large selection of pets you can
        purchase online!
      </p>
      <div className="animal-cards">
        <div className="bear-card">
          <h3>We have Bears!</h3>
          <img src={Bear} alt="bear" />
          <p>
            This is John. He is 15 years old. He likes to play ball and go
            fishing at the nearby rivers/lakes
          </p>
        </div>
      </div>
    </div>
  );
};

export default Landing;
